import { Page, Layout, TextStyle } from '@shopify/polaris';

const Index = () => (
    <Page>
      <Layout>
        <p>Hola desde mi app con React y Next.js</p>

        <TextStyle variation="positive">
          Sample app using React and Next.js
        </TextStyle>
      </Layout>
      
    </Page>
    
  );
  
  export default Index;
